const Navbar=()=>{
    return(
<div>
<div>
    <h5>Connect<br></br>Distribution</h5>
   <details>
   <summary><FontAwesomeIcon icon={faUser} />PrimeCare Pharma</summary>
   <p>Change Password</p>
   <p>LogOut</p>
   </details>

</div>
</div>
);
};

export default Navbar;
